import React,{ Component } from "react";
import "./Rules.css"


class Rules extends Component{
    render(){
        return (
        <div>
            <i class="fas fa-arrow-down neon-blue"></i>
            <i class="fas fa-arrow-down neon-orange"></i>
            <i class="fas fa-arrow-down neon-blue"></i>
            <h1 class="neon-blue">Rules</h1>
            <h3>Objective: Turn all the lights off</h3>
            <img alt="rules-gif" className="rules-img" src="https://i.gyazo.com/9ea0d8da36968be4ccf0b3dbc2da7d3d.gif"></img>
            <i class="fas fa-arrow-up neon-orange"></i>
            <i class="fas fa-arrow-up neon-blue"></i>
            <i class="fas fa-arrow-up neon-orange"></i>
        </div>
        )
    }
}

export default Rules;
